        公共void runtransaction（字符串myconnstring）
        {
        mySqlConnection myConnection = new MySqlConnection（myConnstring）;
        myConnection.open（）;

        mySqlCommand myCommand = myConnection.CreateCommand（）;
        mysqltransaction mytrans;

        //开始本地交易
        myTrans = myConnection.beginTransaction（）;
        //必须分配事务对象和连接
        //命令对象进行待处理的本地事务
        mycommand.connection = myConnection;
        mycommand.transaction = myTrans;

        尝试
        {
        mycommand.commandText =“插入test（id，desc）值（100，'description'）”;
        mycommand.executenonquery（）;
        mycommand.commandText =“插入test（id，desc）值（101，'description'）”;
        mycommand.executenonquery（）;
        myTrans.commit（）;
        Console.Writeline（“两个记录都写入数据库。”）;
        }
        捕获（异常E）
        {
        尝试
        {
        myTrans.rollback（）;
        }
        捕获（Sqlexception EX）
        {
        如果（myTrans.connection！= null）
        {
        console.writeline（“类型的例外” + ex.getType（） +
        “试图退回交易时遇到了遇到。”）；
        }
        }

        console.writeline（“类型的例外” + e.getType（） +
        “在插入数据时遇到了。”）；
        console.writeline（“两个记录都没有写入数据库。”）;
        }
        最后
        {
        myConnection.Close（）;
        }
        }

